    <div data-v-082a8f4f="" class="text-slate-700 border-b mb-8 blog-content">
        <h1>Aile Hukuku</h1>
        <p>
            Aile hukuku, aile bireyleri arasndaki ilikileri dzenleyen, evlilik, boanma, velayet, nafaka gibi konular kapsayan bir hukuk daldr. Aile hukuku, bireylerin aile iindeki haklarn ve ykmllklerini belirler.
        </p>

        <h2>Boanma Davalar</h2>
        <p>
            Aile hukuku, anlamal ve ekimeli boanma davalarnn ynetilmesini, bu davalar srasnda ortaya kan nafaka, mal paylam ve velayet gibi konularn dzenlenmesini salar.
        </p>

        <h2>Nafaka ve Mal Paylam</h2>
        <p>
            Boanma srecinde veya sonrasnda elerin ve ocuklarn maddi gvencelerinin salanmas amacyla nafaka belirlenir. Ayrca, mal rejimi davalar ile mal paylam dzenlenir ve taraflar arasndaki anlamazlklarn zm salanr.
        </p>

        <h2>Velayet Davalar</h2>
        <p>
            ocuklarn velayeti konusunda ortaya kan uyumazlklarn zm, velayet hakknn hangi ebeveyne verilecei ve ocuklarn haklarnn korunmas aile hukuku kapsamnda deerlendirilir.
        </p>

        <h2>Soyba ve Evlat Edinme</h2>
        <p>
            Soyba davalar, biyolojik veya hukuki olarak bir ocuun ebeveynleri ile olan ilikisini dzenler. Ayrca, evlat edinme sreleri ve bu srelerin hukuki boyutlar aile hukuku erevesinde ele alnr.
        </p>

        <h2>Evlilik Szlemeleri</h2>
        <p>
            Evlilik ncesi veya evlilik sresince taraflar arasnda yaplacak olan mal rejimi szlemeleri, aile hukuku tarafndan dzenlenir ve bu szlemelerin geerlilii hukuki olarak denetlenir.
        </p>

        <h2>Genel Olarak Hukuki Danmanlk Verdiimiz Alanlar</h2>
        <ul>
            <li>Anlamal ve ekimeli boanma davalar,</li>
            <li>Nafaka, mal paylam ve velayet konularnda hukuki destek,</li>
            <li>Evlilik ncesi ve evlilik ii szlemelerin hazrlanmas,</li>
            <li>Mal rejimi davalar,</li>
            <li>Soyba davalar,</li>
            <li>Evlat edinme ilemleri ve hukuki danmanlk.</li>
        </ul>
    </div>
